import React from "react";
import Aside from "../../Sidebars.js/Aside";
const InsideTask = () => {
  return (
    <>
      <Aside />
      <div class="p-4 sm:ml-64">
        <div class="p-4 border-2 border-gray-200 border-dashed rounded-lg dark:border-gray-700">
          <div>InsideTask</div>
        </div>
      </div>
    </>
  );
};

export default InsideTask;
